using System;
using System.Collections.Generic;
using FullSerializer;

namespace ImageReality
{
	class MainClass
	{

		static readonly fsSerializer _serializer = new fsSerializer();

		public static void Main (string[] args)
		{
			Console.OutputEncoding = System.Text.Encoding.UTF8;

			args = Sample ();

			if (args.Length != 5) {
				Console.WriteLine ("{\"error\": \"Invalid Number of Parameters: must provide CardWidth, CardHeight, DPI, GuideLineSize (0 for none), array of encoded images [base64, base64, base64]\"}");
				return;
			}

			Input input = new Input ();
			input.CardWidth = Convert.ToDouble(args [0]);
			input.CardHeight = Convert.ToDouble(args [1]);
			input.DPI = Convert.ToInt32(args [2]);
			input.GuideLineSize = Convert.ToDouble(args [3]);

			string imageArray = args [4];
			//Remove [ ]
			imageArray = imageArray.Substring (1, imageArray.Length - 2);
			imageArray = imageArray.Replace (" ", "");
			string[] components = imageArray.Split (new [] { "," }, StringSplitOptions.RemoveEmptyEntries);

			input.Images = new List<string>(components);

			List<string> cardSheets = input.GenerateCardSheets ();

			CardSheets output = new CardSheets ();

			output.cardSheets = cardSheets.ToArray();

			fsData serializedData;
			_serializer.TrySerialize(typeof(CardSheets), output, out serializedData);
			string result = fsJsonPrinter.PrettyJson(serializedData);

			Console.Write (result);

//			string inputJson = "";
//			fsData data = fsJsonParser.Parse(inputJson);
//
//			object deserialized = null;
//			_serializer.TryDeserialize(data, typeof(CharacterDesc), ref deserialized);
//

		}

		public static string[] Sample() {
			string[] args = new string[5];
			args[0] = "" + 2.5;
			args[1] = "" + 3.5;
			args[2] = "" + 300;
			args[3] = "" + 0.05;


			const string image1 = "";
			const string image2 = "";
			const string image3 = "";
			const string image4 = "";
			const string image5 = "";
			const string image6 = "";
			const string image7 = "";
			const string image8 = "";
			const string image9 = "";
			const string image10 = "";
			string[] images = new [] { image1, image2, image3, image4, image5, image6, image7, image8, image9, image10 };
			string imgArray = "[" + string.Join (", ", images) + "]";
			args [4] = imgArray;
			return args;
		}
	}
}
